package com.example.TicTacToe.DTO;import javax.persistence.MappedSuperclass;import javax.validation.constraints.NotNull;import java.io.Serializable;@MappedSuperclasspublic class PlayerDTO implements Serializable{    @NotNull    private String userName;    @NotNull    private String password;    @NotNull    private String email;    public PlayerDTO() {    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }}